import { enumExternalMethod, enumMergeSettingMatch, enumStatus, enumTypeAdditionalFields } from "@configs";

export interface IMerchant {
    _id?: string;
    name: string;
    subColor?: string;
    themeColor: string;
    logoUrl: string;
    googleAnalytics?: string;
    createdBy?: string;
    welcomeImageUrls?: string[];
    welcomeDescription?: string;
    welcomeColor?: string;
    additionalFields?: IAdditionalField[];
    levels?: ILevelId;
    planId?: string;
    status?: enumStatus;
    signUpSettings?:ISignUpSettings;
}

export interface ISignUpSettings {
    signUpMethods:enumExternalMethod[];
}
export interface IAdditionalField {
    _id?: string;
    label: string;
    type: enumTypeAdditionalFields;
    typeOptions: string[];
    isRequired: boolean;
}

export interface ILevelId {
    _id?: string;
    name: string;
    description: string;
    point: number;
    status: enumStatus;
}

export interface IMergeSettings {
    isTel: boolean;
    isEmail: boolean;
    isLineId: boolean;
    isAutoMerge: boolean;
    match: enumMergeSettingMatch;
}

export interface IMerchantQRcode {
    code: string;
    createdAt: string;
    imageUrl: string[];
    levelIds: string[];
    merchantId: string;
    name: string;
    qrImageLink:string;
    qrToken: string;
    status: enumStatus;
}
